import React from 'react';

class ManageData extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      color: `${this.props.color}`,
    }
  }

  render() {
    return (
      <p>Color is {this.state.color}</p>
    )
  }
}

export default ManageData;
